const servicesImages = {
  'Kitchens': '/kitchen.jpg',
  'Loft Conversions': '/loft-conversions.png',
  'Bathrooms': '/bathroom.png',
  'Extensions': '/extension.png',
  'Restorations': '/restoration.png',
  'External Works': '/external-works.png',
};

function ServiceImage({ service }) {
  const imageSrc = servicesImages[service] || '/default-image.jpg'; // Fallback image

  return (
    <div className="relative 2xl:w-[680px] 2xl:h-[777.1px] max-sm:w-[295px] max-sm:h-[337.13px] min-[1440px]:w-[600px] min-[1440px]:h-[685.68px] xl:w-[560px] xl:h-[639.97px] lg:w-[432px] lg:h-[493.69px]">
      <Image
        src={imageSrc}
        alt={`${service} image`}
        className="object-cover rounded-[12px]"
        fill
      />
    </div>
  );

}

export default function ServicesContent() {
  const [expanded, setExpanded] = useState('panel1'); // Set default expanded panel here
  const [service, setService] = useState('Kitchens');
  const rootRef = useRef(null);
  const imageWrapRef = useRef(null);
  const detailsRefs = useRef({});
  const summaryRefs = useRef({});
  const iconRefs = useRef({});

  useEffect(() => {
    gsap.registerPlugin(ScrollTrigger);
    const ctx = gsap.context(() => {
      // Fade in container children on enter
      const items = rootRef.current?.querySelectorAll('.svc-accordion-item');
      if (items && items.length) {
        gsap.set(items, { autoAlpha: 0, y: 12 });
        items.forEach((el, i) => {
          gsap.to(el, {
            autoAlpha: 1,
            y: 0,
            duration: 0.25,
            ease: 'power2.out',
            delay: i * 0.05,
            scrollTrigger: {
              trigger: el,
              start: 'top 85%'
            }
          });
        });
      }

      // Image default state
      if (imageWrapRef.current) {
        gsap.set(imageWrapRef.current, { autoAlpha: 0, scale: 0.98 });
        gsap.to(imageWrapRef.current, {
          autoAlpha: 1,
          scale: 1,
          duration: 0.3,
          ease: 'power2.out',
          scrollTrigger: {
            trigger: imageWrapRef.current,
            start: 'top 85%'
          }
        });
      }
    }, rootRef);

    return () => ctx.revert();
  }, []);

  const handleChange = (panel, serviceName) => (_event, isExpanded) => {
    setExpanded(isExpanded ? panel : false);
    if (isExpanded) {
      setService(serviceName);
    }
  };
  
  const accordionData = [
    { panel: 'panel1', title: 'Kitchens', icon: <KitchenIcon />, content: 'At LifetimeArt, we design and build stunning kitchens tailored to your style and needs. Whether you prefer sleek modern lines or a timeless, classic look, our team delivers premium craftsmanship, functional layouts, and meticulous attention to detailcreating a kitchen youll love to cook and gather in.' },
    { panel: 'panel2', title: 'Loft Conversions', icon: <LoftIcon />, content: 'Transform unused loft space into a beautiful, practical part of your home. From cozy bedrooms to bright home offices, we handle everything from structural adjustments to finishing touches, ensuring your new space is safe, stylish, and seamlessly integrated with your existing home.' },
    { panel: 'panel3', title: 'Bathrooms', icon: <BathroomsIcon />, content: 'We create bathrooms that balance relaxation and practicality, with designs ranging from spa-inspired retreats to minimalist, functional spaces. Our team sources high-quality fixtures and finishes, ensuring durability, elegance, and comfort for years to come.' },
    { panel: 'panel4', title: 'Extensions', icon: <ExtensionsIcon />, content: 'Expand your living space without compromising on style. Whether its a kitchen extension, a new family room, or an entire additional floor, we work closely with you to design and build an extension that complements your home and adds value.' },
    { panel: 'panel5', title: 'Restorations', icon: <RestorationsIcon />, content: 'Preserve the charm of your property while upgrading it for modern living. Our restoration work combines traditional craftsmanship with modern techniques to breathe new life into historic or worn-down spaces.' },
    { panel: 'panel6', title: 'External Works', icon: <ExternalWorksIcon />, content: 'Enhance the beauty and functionality of your outdoor areas. From garden landscaping to patios, pathways, and exterior lighting, we create inviting spaces that connect your home to nature.' },
  ];

  // Animate transitions when expanded changes
  useEffect(() => {
    // Rotate expand icons
    Object.entries(iconRefs.current).forEach(([panelKey, el]) => {
      if (!el) return;
      const isActive = expanded === panelKey;
      gsap.to(el, {
        rotate: isActive ? 90 : 0,
        duration: 0.2,
        ease: 'power2.out'
      });
    });

    // Image panel: fade + slight scale when active changes
    if (imageWrapRef.current) {
      gsap.fromTo(
        imageWrapRef.current,
        { autoAlpha: 0, scale: 0.98 },
        { autoAlpha: 1, scale: 1, duration: 0.3, ease: 'power2.out' }
      );
    }

    // Details: fade in from right when active
    const activeDetails = detailsRefs.current[expanded];
    if (activeDetails) {
      gsap.fromTo(
        activeDetails,
        { autoAlpha: 0, x: 16 },
        { autoAlpha: 1, x: 0, duration: 0.3, ease: 'power2.out' }
      );
    }
  }, [expanded]);

  return (
    <div ref={rootRef} className="flex items-center self-center gap-20 max-w-[1440px] 2xl:w-[1440px] max-sm:flex-col">
      <div ref={imageWrapRef} className="svc-image">
        <ServiceImage service={service} />
      </div>
      <div className="flex flex-col 2xl:w-[680px] max-sm:w-[295px] min-[1440px]:w-[600px] xl:w-[560px] lg:w-[432px]">
        {accordionData.map(({ panel, title, icon, content }) => (
          <Accordion
            key={panel}
            className="svc-accordion-item"
            expanded={expanded === panel}
            onChange={handleChange(panel, title)}
            sx={{
              borderBottom: '1px solid #DBDAD9',
              boxShadow: 'none',
              '&:before': { display: 'none' },
              '&.Mui-expanded': { margin: 0 },
            }}
          >
            <AccordionSummary
              ref={(el) => { summaryRefs.current[panel] = el; }}
              sx={{
                py: '20px',
                px: 0,
                minHeight: 0,
                '&.Mui-expanded': { minHeight: 0 },
                '& .MuiAccordionSummary-content': { m: 0, minWidth: 0 },
                '& .MuiAccordionSummary-content.Mui-expanded': { m: 0 },
                '&:not(.Mui-expanded) h4': { transition: 'color 150ms ease', color: '#101014' },
                '&.Mui-expanded h4': { color: '#101014' },
                '&:hover h4': { color: '#3f3f44ff' },
              }}
              expandIcon={
                <span
                  ref={(el) => { iconRefs.current[panel] = el; }}
                  style={{ display: 'inline-flex' }}
                >
                  {expanded === panel ? <CloseIcon /> : <PlusIcon />}
                </span>
              }
              aria-controls={`${panel}-content`}
              id={`${panel}-header`}
            >
              <Typography
                component="h4"
                noWrap
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  gap: '20px',
                  fontFamily: 'Manrope',
                  fontStyle: 'normal',
                  fontWeight: 500,
                  fontSize: '20px',
                  lineHeight: '120%',
                  letterSpacing: '-0.2px',
                  color: '#101014',
                  flex: 1,
                  minWidth: 0,
                  whiteSpace: 'nowrap',
                  overflow: 'hidden',
                  textOverflow: 'ellipsis',
                }}
              >
                {icon}
                {title}
              </Typography>
            </AccordionSummary>
            <AccordionDetails
              ref={(el) => { detailsRefs.current[panel] = el; }}
              sx={{
                p: 0,
                display: 'flex',
                alignItems: 'center',
                width: '100%',
                fontFamily: 'Manrope',
                fontStyle: 'normal',
                fontWeight: 400,
                fontSize: '16px',
                lineHeight: '170%',
                letterSpacing: '-0.1px',
                color: '#3D3D47',
                pb: '32px',
                pt: '20px',
              }}
            >
              {content}
            </AccordionDetails>
          </Accordion>
        ))}
      </div>
    </div>
  );
}


